description:
This key chain is part of my &#8220;Just For Fun&#8221; collection. Looks like a fashion version of a military dog tag&#8230;

	I hand drilled this bright red silk-screened metal pendant charm. The front of the tag says music with a musical notation (the back is plain red). I then hammered in a small white grommet and complimented the tag with a silver bead on a solid silver chain link with a keyring; chain measures 4in or 10cm long. Would look great with an Ipod, a purse decoration, or have your keys make a statement about you!

	As you may notice I have a large selection of tags&#8230;Let me know if you see something else you like..I can customize the grommet color and hole placement..longer chain..no chain..add a leather key fob&#8230;Make you a bracelet, necklace, earrings, or cell phone charm. I will try to do what ever you want!
